import React, { useState } from 'react';
import '../styles/Profile.css';

function ProfilePage() {
  const [formData, setFormData] = useState({
    name: 'ÌôçÍ∏∏Îèô',
    email: 'hong@gmail.com'
  });

  const [allergies, setAllergies] = useState(['Í∞ëÍ∞ÅÎ•ò']);
  const [dietaryRestrictions, setDietaryRestrictions] = useState(['Ï±ÑÏãù']);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('ÌîÑÎ°úÌïÑ Ï†ÄÏû•:', formData, allergies, dietaryRestrictions);
    alert('ÌîÑÎ°úÌïÑÏù¥ Ï†ÄÏû•ÎêòÏóàÏäµÎãàÎã§!');
  };

  const allergyOptions = ['ÎïÖÏΩ©', 'Í∞ëÍ∞ÅÎ•ò', 'Í≤¨Í≥ºÎ•ò', 'Ïú†Ï†úÌíà', 'Í≥ÑÎûÄ', 'Î∞Ä'];
  const dietOptions = ['Ï±ÑÏãù', 'ÎπÑÍ±¥', 'Ìï†ÎûÑ', 'Ï†ÄÏóºÏãù'];

  const toggleAllergy = (allergy) => {
    setAllergies(prev =>
      prev.includes(allergy)
        ? prev.filter(a => a !== allergy)
        : [...prev, allergy]
    );
  };

  const toggleDiet = (diet) => {
    setDietaryRestrictions(prev =>
      prev.includes(diet)
        ? prev.filter(d => d !== diet)
        : [...prev, diet]
    );
  };

  return (
    <div className="profile-container">
      {/* Ìó§Îçî */}
      <header className="dashboard-header">
        <div className="logo">üç≥ RecipeNote</div>
        <nav className="nav">
          <a href="/dashboard">ÎÇ¥ Î†àÏãúÌîº</a>
          <a href="/profile">ÌîÑÎ°úÌïÑ</a>
          <a href="/login">Î°úÍ∑∏ÏïÑÏõÉ</a>
        </nav>
      </header>

      {/* Î©îÏù∏ ÏΩòÌÖêÏ∏† */}
      <div className="profile-content">
        <div className="profile-section">
          <div className="page-header">
            <h1 className="page-title">ÌîÑÎ°úÌïÑ ÏÑ§Ï†ï</h1>
            <p className="page-subtitle">ÎÇòÏóêÍ≤å ÎßûÎäî Î†àÏãúÌîºÎ•º Ï∂îÏ≤úÎ∞õÏúºÏÑ∏Ïöî</p>
          </div>

          <div className="profile-avatar">üë§</div>

          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Ïù¥Î¶Ñ</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
              />
            </div>

            <div className="form-group">
              <label>Ïù¥Î©îÏùº</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                disabled
                style={{ background: '#F7F9FC' }}
              />
            </div>

            <h2 className="section-title">üö´ ÏïåÎ†àÎ•¥Í∏∞</h2>
            <div className="checkbox-group">
              {allergyOptions.map((allergy) => (
                <label key={allergy} className="checkbox-item">
                  <input
                    type="checkbox"
                    checked={allergies.includes(allergy)}
                    onChange={() => toggleAllergy(allergy)}
                  />
                  {allergy}
                </label>
              ))}
            </div>

            <h2 className="section-title">ü•ó ÏãùÎã® Ï†úÏïΩ</h2>
            <div className="checkbox-group">
              {dietOptions.map((diet) => (
                <label key={diet} className="checkbox-item">
                  <input
                    type="checkbox"
                    checked={dietaryRestrictions.includes(diet)}
                    onChange={() => toggleDiet(diet)}
                  />
                  {diet}
                </label>
              ))}
            </div>

            <button type="submit" className="btn-primary">
              Ï†ÄÏû•ÌïòÍ∏∞
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default ProfilePage;
